import React, { Component } from 'react';

class Card extends Component {
  constructor(props) {
    super(props);
    this.onClick = this.onClick.bind(this);
  }
  onClick(e) {
    console.log(this.props.title);
  }
  render() {
    return (
      <div className="project-card">
        <h2>{this.props.title}</h2>
        <p>{this.props.description}</p>
      </div>
    );
  }
}
//functions

export default Card;
